    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed

        JOptionPane.showMessageDialog(this, "Buenas, por favor registra los datos del dia de Roberto.");
        Persona Roberto= new Persona(NORMAL, HEIGHT, NORMAL, NORMAL);
        Roberto.registrarDatos();
        
        int corteCabello = Roberto.GetcorteCabello();
        int corteDama = Roberto.GetcorteDama();
        int peinado = Roberto.Getpeinado();
        int tintura = Roberto.gettinturaCabello();
        int totalServicios = Roberto.GettotalServicios();
        int totalRecaudo = Roberto.GettotalRecaudo();
        
        String corteCabello1 = Integer.toString(corteCabello);
        String CorteDama1 = Integer.toString(corteDama);
        String peinado1 = Integer.toString(peinado);
        String tintura1 = Integer.toString(tintura);
        String totalServicios1 = Integer.toString(totalServicios);
        String totalRecaudo1 = Integer.toString(totalRecaudo);
        
        ccr.setText(corteCabello1);
        cdr.setText(CorteDama1);
        pr.setText(peinado1);
        tcr.setText(tintura1);
        tsr.setText(totalServicios1);
        trr.setText(totalRecaudo1);
    }//GEN-LAST:event_jButton2ActionPerformed

